import { Link } from "react-router-dom"

const EVENTs = [{
    id: 'e1',
    title: 'Some Event'
},
{
    id: 'e2',
    title: 'Some Event'
},
{
    id: 'e3',
    title: 'Some Event'
}
]

function EventPage() {
    return (
        <>
            <h1> Event Page</h1>
            <ul>
                {EVENTs.map(e => (
                    <li key={e.id}> <Link to={e.id}>{e.title}</Link>  </li>
                ))}
            </ul>
        </>

    )
}

export default EventPage
